Prefix: '&e%plugin% &8» &7'
Core:
  Command:
    Usage: '&c* Usage: &f/%label% %cmd% %usage%'
    Help:
      Format: '&6» &e/%label% %cmd% %usage% &7- %description%'
      List:
      - '&8&m━━━━━━━━━━━━&8&l[ &e&l%plugin% &7- &6&lHelp &8&l]&8&m━━━━━━━━━━━━'
      - '%cmds%'
      Desc: Show help page.
    Editor:
      Desc: Opens GUI Editor.
    About:
      Desc: Some info about the plugin.
    Reload:
      Desc: Reload the plugin.
      Done: Reloaded!
    Statistics:
      Desc: Core statistics.
      Usage: '[disable/silent]'
      Disable: Statistic has been disabled. Module will be unloaded on server reload.
      Silent: On-Join statistic info has been hidden.
  Statistics:
    Info:
    - '&6&m                     &6&l[ &e&lFCore Statistics &4Beta &6&l]&6&m                     &6'
    - '&eYou have enabled &6''statistics'' &emodule in &6config.yml&e.'
    - '&eThis means the plugin will sent data about our plugins to our website.'
    - '&7'
    - '&3▸ &bYou''re running &a%child-plugin% &btogether with &a%count% &bservers!&7'
    - '&7        %button_disable%       %button_silent%'
    Button:
      Disable:
        Text: '&c&l[Stop This!]'
        Hint: '&7Statistics module will be disabled.'
      Silent:
        Text: '&6&l[You Bored Me]'
        Hint: '&7Disables on-join statistics show.'
